import React from 'react'
import { Button } from "react-native";
import { linkTo } from '../commons/util.common';

const HomeScreen = ({navigation, route}) => {
    const a = () => console.log('eeee')
    return (
    <Button
        title="prueba"
        onPress={()=> linkTo(navigation, 'Profile', {
            name: 'Jane',
            a
        })}
    />
)}

export default HomeScreen
